Wanted to make a post about this incredible piece of artwork made by my friend the very talented and beautiful @lersia !  She does a lot of cool mechanical engineering paintings check her page!
The NRE 2000+hp twin turbo LS7 creation known as mayhem is the inspiration for this project, my part of which is the design and creation of its Zpipe turbo system. 
I’ve got to say it’s quite cool when someone paints something you’ve designed!! I’m honored 😎
